package com.zrgk.entity;


public class Temp {
 private int id;
 private String name;
public Temp() {
	super();
	// TODO Auto-generated constructor stub
}
public Temp(int id, String name) {
	super();
	this.id = id;
	this.name = name;
}
public int getId() {
	return id;
}
public void setId(int id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
 
}
